INSERT INTO `ecom_products` (`PRODUCT_ID`, `PRODUCT_CATEGORY`, `PRODUCT_SUB_CAT`, `PRODUCT_TITLE`, `HSN_CODE`, `PRODUCT_BRAND`, `PRODUCT_VEG_NON`, `PRODUCT_SIZE`, `PRODUCT_SUBSCRIBE_YN`, `PRODUCT_DESCRIPTION`, `PRODUCT_QTY_ALLOW`, `PRODUCT_IMAGE1`, `PRODUCT_IMAGE2`, `PRODUCT_IMAGE3`, `PRODUCT_IMAGE4`, `PRODUCT_STATUS`, `PRODUCT_PRICE`, `STOCK_AVAILABILITY`, `STOCK_QTY`, `FEATURED_PRODUCTS`, `BEST_SELLING_PRODUCTS`, `SHOW_PRODUCTS`, `CREATION_DATE`) VALUES
(1, 2, 1, 'Amul Cow Milk', '0', 1, 'VEG', '500 ML', 'YES', '<p>Amul Cow Milk (Polypack) Is Pure And Pasteurized Milk With Great Nutritional Value. It Can Be Consumed Directly Or Can Be Used For Preparing Tea, Coffee, Sweets, Khoya, Curd, Buttermilk, Ghee Etc.</p>\r\n', 0, '1644304615amul-cow-milk-pouch-1.jpg', '1644304615amul-cow-milk-pouch-2.jpg', '1644304615amul-cow-milk-pouch-3.jpg', '1644304615amul-cow-milk-pouch-4.jpg', 'SHOW', 25, 'YES', 189, 'YES', 'YES', '', '2022-02-08 00:16:55'),
(2, 2, 1, 'Mother Dairy Milk-Toned - Regular Pack', '0', 2, 'VEG', '500 ML', 'YES', '<p>Mother Dairy Toned Milk.<br />\r\nMinimum Fat: 3%, Minimum SNF: 8.5%</p>\r\n\r\n<p>Shelf Life:&nbsp;48 Hours From The Date Of Packing If Kept Under Refrigeration Below 8 Degrees C</p>\r\n\r\n<p>Storage Conditions:&nbsp;Under Refrigeration (Below 8 Degrees C)</p>\r\n', 0, '1644305291mother-dairy-milk-toned-regular-pack-1.jpg', '1644305291mother-dairy-milk-toned-regular-pack-2.jpg', '1644305291mother-dairy-milk-toned-regular-pack-3.jpg', '1644305291mother-dairy-milk-toned-regular-pack-4.jpg', 'SHOW', 35, 'YES', 193, 'YES', 'YES', '', '2022-02-08 00:28:11'),
(3, 2, 1, 'Mother Dairy Milk-Full Cream - Regular Pack', '0', 2, 'VEG', '500 ML', 'YES', '<p>Mother Dairy Full Cream Milk &ndash; Wholesome And Healthy. Packed With Energy And Nutrition That&rsquo;S Essential For Growing Kids. It Makes Them Stronger From Within And Keeps Them Active And Healthy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Mother Dairy Full Cream Milk.<br />\r\nMinimum Fat: 6%, Minimum SNF: 9%</p>\r\n\r\n<p>Shelf Life:48 Hours From The Date Of Packing If Kept Under Refrigeration Below 8 Degree C</p>\r\n\r\n<p>Storage Conditions: Under Refrigeration (Below 8 Degree C)</p>\r\n', 0, '1644305385mother-dairy-milk-full-cream-regular-pack-1.jpg', '1644305385mother-dairy-milk-full-cream-regular-pack-2.jpg', '1644305385mother-dairy-milk-full-cream-regular-pack-3.jpg', '1644305385mother-dairy-milk-full-cream-regular-pack-4.jpg', 'SHOW', 30, 'YES', 194, 'YES', 'YES', '', '2022-02-08 00:29:45'),
(4, 2, 1, 'Cow Milk Mother Dairy', '0', 2, 'VEG', '500 ML', 'YES', '<p>Mother Dairy Cow Milk Contains Protein And Is Strongly Recommended For Children After Mothers MilkThe Milk Also Helps In Digestion. Mother Dairy Cow Milk Contains Simple Proteins</p>\r\n', 0, '1644305500cow-milk-mother-dairy-1.jpg', '1644305500cow-milk-mother-dairy-2.jpg', '1644305500cow-milk-mother-dairy-3.jpg', '1644305500cow-milk-mother-dairy-4.jpg', 'SHOW', 25, 'YES', 195, 'YES', 'YES', '', '2022-02-08 00:31:40'),
(5, 2, 1, 'Cow Milk Ananda', '0', 7, 'VEG', '500 ML', 'YES', '<p>Cow Milk Ananda</p>\r\n', 0, '1644305658cow-milk-ananda-1.jpg', '1644305658cow-milk-ananda-2.jpg', '1644305658cow-milk-ananda-3.jpg', '1644305658cow-milk-ananda-4.jpg', 'SHOW', 25, 'YES', 193, 'YES', 'YES', '', '2022-02-08 00:34:18');
