INSERT INTO `ecom_web_pages` (`STORE_ID`, `WEB_PAGE_ID`, `PAGE_TITLE`, `PAGE_CONTENT`, `CREATION_DATE`) VALUES
(1, 1, 'About Us', '<p><strong>We RROSDAILY and We are committed to fulfil all your delivery needs. Launched in early 2022, RROSDAILY.COM is India&#39;s first and daily micro-delivery service. Built on the unique Indian habit of getting fresh milk &amp; grocery delivered at your doorstep every day as per your convenient. RROSDAILY (accessible on rrosdaily.com) is today fulfiling the entire grocery needs of a household everyday before 8:00 a.m . To enable frequent and friction- less buying, rrosdaily has innovated monthly pass ordering and contactless delivery - both a first in the ecommerce industry - and favourites of rrosdaily customers.</strong></p>\r\n\r\n<h2><strong>MISSION &amp; VISION</strong></h2>\r\n\r\n<p><strong>Rrosdaily&#39;s mission statement is significant because it speaks directly to buyers. It&#39;s tailored around Rrosdaily&#39;s more environmentally conscious customers who are likely to pay a higher price tag for high quality, well-built, sustainable products. We are here to help our customer&#39;s, we do thatby living our strategy and ruthlessly prioritizing our work to create simple elegant technology that delights our customers-all while delivering service that is second to none. Every single day we join forces across teams and groups to break down barriers, build new markets and stare down the impossible until the impossible blinks.</strong></p>\r\n', '2022-01-24'),
(1, 2, 'Cancellation Policy', '<p><strong>You can cancel an order any time before 11 pm the day prior to delivery. In case you choose to cancel a delivery in an active subscription, your subscription balance will be adjusted &amp; carried forward accordingly. When you cancel a one-time milk order, the service fee charged will automatically be refunded to your Wallet. Service fees on one-time grocery orders will only be refunded if all one-time grocery orders on a given date are cancelled.</strong></p>\r\n\r\n<p><strong>If we suspect any fraudulent transaction by any customer or any transaction which defies the terms &amp; conditions of using the website, we at our sole discretion could cancel such orders. We will maintain a negative list of all fraudulent transactions and customers and would deny access to them or cancel any orders placed by them.</strong></p>\r\n\r\n<p><strong>RROSDAILY has no question asked return policy if you are not satisfied with the quality of the products delivered to you. You can either return the products to the delivery personnel at the time of delivery or you can contact our customer support team and we will do the needful.</strong></p>\r\n\r\n<p><strong>We want you to be happy with your purchase. If you are dissatisfied with an item, please return it, complete register receipt for a refund or exchange.</strong></p>\r\n\r\n<p><strong>All claims must be made to our customer service department within 24 hour of delivery. We request that the damaged items received be returned to us with original manufacturer&#39;s/supplier&#39;s packing. We will refund to your account if the same items are not available.</strong></p>\r\n\r\n<p><strong>To request a return, contact us on Application or mail our Customer Support at email. Please provide the following information in your email: customer name, order number, product name (product description) in question, and the nature of the problem. Customer would be contacted with return authorization and notify further process.</strong></p>\r\n\r\n<p><strong>Thank you for shopping at https://www.rrosdaily.com If, for any reason, You are not completely satisfied with a purchase, we invite You to review our Policy.</strong></p>\r\n\r\n<p><strong>The following terms are applicable for any products that you purchased with us.</strong></p>\r\n\r\n<p><strong>INTERPRETATION AND DEFINITIONS</strong></p>\r\n\r\n<p><strong>Interpretation</strong></p>\r\n\r\n<p>The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</p>\r\n\r\n<h3><strong>Definitions</strong></h3>\r\n\r\n<p>For the purposes of this Return and Exchange Policy:</p>\r\n\r\n<p><strong>Individual</strong>&nbsp;(referred to as either &quot;the Company&quot;, &quot;We&quot;, &quot;Us&quot; or &quot;Our&quot; in this Agreement) refers to&nbsp;<strong>RROSDAILY</strong>&nbsp;Located at&nbsp;<strong>IN</strong>.</p>\r\n\r\n<p><strong>Goods</strong>&nbsp;refer to the items offered for sale on the Service.</p>\r\n\r\n<p><strong>Orders</strong>&nbsp;mean a request by You to purchase Goods from Us.</p>\r\n\r\n<p><strong>Service</strong>&nbsp;refers to the Website.</p>\r\n\r\n<p><strong>Website</strong>&nbsp;refers to My Site, accessible from&nbsp;<strong>https://www.rrosdaily.com</strong></p>\r\n\r\n<p><strong>You</strong>&nbsp;means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</p>\r\n\r\n<h2><strong>GENERAL RETURN POLICY</strong></h2>\r\n\r\n<p>We want you to be happy with your purchase. If you are not completely satisfied, you can return the product to us and we will either repair/replace it, or credit your account. You are eligible for a<strong>&nbsp;REFUND or EXCHANGE</strong>&nbsp;which are subject to the below terms:</p>\r\n\r\n<p>If the product you have received which turns out to be defective or otherwise of poor quality (save for direct warranty products which are discussed below), please notify us as soon as reasonably possible after you become aware of the defect or poor quality.</p>\r\n\r\n<p>Products that are bought from the&nbsp;<strong>Physical Stores can&rsquo;t be returned.&nbsp;</strong>All Items are eligible for return and would be processed if conditions are met.</p>\r\n\r\n<p><strong>REFUND POLICY</strong></p>\r\n\r\n<p>In order to be eligible for a refund, you have to return the goods within&nbsp;<strong>7</strong>&nbsp;days of your purchase.&nbsp;If the product is damaged in any way, or you have initiated the return after&nbsp;<strong>7</strong>&nbsp;days have passed, you will not be eligible for a refund.</p>\r\n\r\n<ul>\r\n	<li><strong>Product must be returned in its original packaging</strong></li>\r\n	<br />\r\n	<li><strong>Product wasn&#39;t used or damaged</strong></li>\r\n	<br />\r\n	<li><strong>Product must include original tags (if applicable)</strong></li>\r\n	<br />\r\n	<li><strong>Product must have the receipt or proof of purchase</strong></li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><strong>Product wasn&#39;t used or damaged</strong></li>\r\n	<br />\r\n	<li><strong>Product must include original tags (if applicable)</strong></li>\r\n	<br />\r\n	<li><strong>Product must have the receipt or proof of purchase</strong></li>\r\n</ul>\r\n\r\n<p>After we receive your product, our team of professionals will inspect it and process your refund. The money will be refunded to the&nbsp;<strong>Original Payment Method</strong>&nbsp;you&rsquo;ve used during the purchase.</p>\r\n\r\n<p><strong>EXCHANGE POLICY</strong></p>\r\n\r\n<p>Product can be exchanged for a different size or color variation, provided that such variation is available. Customers are allowed to exchange for item within&nbsp;<strong>7&nbsp;</strong>days. Exchanges exceeding&nbsp;<strong>7&nbsp;</strong>days will not be processed.</p>\r\n\r\n<p>In order to be eligible for exchanges make sure that these following conditions are met:</p>\r\n\r\n<ul>\r\n	<li><strong>Product must be returned in its original packaging</strong></li>\r\n	<br />\r\n	<li><strong>Product wasn&#39;t used or damaged</strong></li>\r\n	<br />\r\n	<li><strong>Product must include original tags (if applicable)</strong></li>\r\n	<br />\r\n	<li><strong>Product must have the receipt or proof of purchase</strong></li>\r\n</ul>\r\n\r\n<p>You are&nbsp;<strong>required to ship back</strong>&nbsp;the product for the item to be inspected and replaced.</p>\r\n\r\n<p>You exchanged product will be processed&nbsp;<strong>Once items are received and conditions confirmed</strong>.</p>\r\n\r\n<p>You are given the rights to exchange the item,&nbsp;<strong>One time.&nbsp;</strong>Provided that all conditions in Exchange Policy are met.</p>\r\n\r\n<p>Unfortunately, product that were marked as a gift when purchased is&nbsp;<strong>not allowed</strong>&nbsp;to be&nbsp;<strong>Returned or Exchanged.</strong></p>\r\n\r\n<p>If the product were marked as a Bundled when purchased, there some conditions to be followed for it to be eligible for exchange:</p>\r\n\r\n<p><strong>HOW TO INITIATE A RETURN</strong></p>\r\n\r\n<p>If you have a request for Return, Refund or Exchange and if you have further clarification and questions, Please do not hesitate to contact us through our:</p>\r\n\r\n<p>Self-Service Portal:&nbsp;<strong>https://www.rrosdaily.com</strong></p>\r\n\r\n<p>Contact Form URL:&nbsp;<strong>https://www.rrosdaily.com</strong></p>\r\n\r\n<p>Phone Number:&nbsp;<strong>9911332734</strong></p>\r\n\r\n<p>You will be updated for their Return Status through their<strong>&nbsp;EMAIL</strong>&nbsp;and&nbsp;<strong>SMS</strong>&nbsp;provided that all contact information is recorded to us.</p>\r\n', '2022-01-24'),
(1, 3, 'Privacy Policy', '<p>RROSDAILY App and&nbsp;<a href=\"https://www.rrosdaily.com/\" target=\"_blank\">https://www.rrosdaily.com</a>&nbsp;brand are licensed and operated by RROSDAILY. RROSDAILY&nbsp;respects your privacy and values the trust which you are showing towards RROSDAILY. Below are the Company&rsquo;s Privacy Policy which details the way information relating to you is collected, maintained, used and disclosed.</p>\r\n\r\n<p>Customers are advised to read and understand our Privacy Policy carefully, as by accessing the website/app you agree to be bound by the terms and conditions of the Privacy Policy and consent to the collection, storage and use of information relating to you as provided herein. In case you disagree with the terms and conditions of our Privacy Policy, including in relation to the manner of collection or use of your information, kindly do not access this website/app.</p>\r\n\r\n<p><strong>About Personal identification information:</strong>&nbsp;As part of the registration process of the site we may collect personal identification information from Users in a variety of ways, including, but not limited to, when Users visit our application, site, subscribe to the newsletter, fill out a form, and in connection with other activities, services, features or resources we make available on our Site. Users may be asked for, as appropriate, name, email address, mailing address, phone number,&nbsp;the number of times users access the page. Users may, however, visit our Site/app anonymously. Users can always refuse to supply personal identification information, except that it may prevent them from engaging in certain Site related activities.</p>\r\n\r\n<p><strong>Non-personal identification information:</strong>&nbsp;We may collect non-personal identification information about Users whenever they interact with our Site. Non-personal identification information may include the browser name, the type of computer, phone and technical information about Users means the type of connection to our Site, such as the operating system and the Internet service providers utilized and other similar information.</p>\r\n\r\n<p><strong>Age of consent:&nbsp;</strong>By using this site, users confirm that they are at least the age of majority and understand RROSDAILY&nbsp;&rsquo;s policy and have given us the consent to use any information required to use this app/site.</p>\r\n\r\n<p><strong>Web browser cookies:</strong>&nbsp;Our Site may use &quot;cookies&quot; to enhance User experience. User&#39;s web browser places cookies on their hard drive/system for record-keeping purposes and sometimes to track information about them. User may choose to set their web browser to refuse cookies, or to alert the Users when cookies are being sent. If they do so, note that some parts of the application, Site may not function properly.&nbsp;The Site and third-party vendors, including Google, use first-party cookies (such as the Google Analytics cookie) and third-party cookies (such as the DoubleClick cookie) together to inform, optimize and serve ads based on someone&#39;s past visits to the Site.</p>\r\n\r\n<p><strong>How we use collected information</strong>:&nbsp;RROSDAILY&nbsp; app/site may collect and use User&#39;s personal information for the following purposes:</p>\r\n\r\n<ul>\r\n	<li>To improve customer service: Information provided by Users helps us respond to the customer service requests and support needs, more efficiently.</li>\r\n	<li>To personalize User experience:&nbsp;RROSDAILY&nbsp; may use information in the aggregate to understand how our Users as a group use the services and resources provided on our Site.</li>\r\n	<li>To improve our application and site:&nbsp;RROSDAILY&nbsp; may use feedback provided by the User/s to improve our products and services.</li>\r\n	<li>To run a promotion, contest, survey or other application and site feature.</li>\r\n	<li>To provide personalized features to you on the Site and to provide for promotional offers to you through the Site and other channels.</li>\r\n	<li>To send periodic emails: RROSDAILY&nbsp;may use the email address to respond to the inquiries, questions, and/or other requests of User/s. If User/s decide/s to opt to be part of our mailing list, then the User/s will receive emails about company news, updates, related product or service information, etc. If at any time the User/s would like to unsubscribe from receiving future emails, they may do so by contacting us via our site.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>How we protect User&#39;s information:</strong>&nbsp;We adopt appropriate data collection, storage and processing practices and security measures to protect against unauthorized access, alteration, disclosure or destruction of User&#39;s personal information and data stored on our application and Site. Sensitive and private data exchange between the application or Site and its Users happens over a SSL secured communication channel and is encrypted and protected with digital signatures.</p>\r\n\r\n<p><strong>Sharing personal information of User/s:</strong>&nbsp;RROSDAILY&nbsp; (app/site) do not sell, trade, or rent User&#39;s personal identification information to others. We may share generic aggregated demographic information not linked to any personal identification information regarding User/s with our subsidiaries, our business partners, trusted affiliates and advertisers for the purposes outlined above.</p>\r\n\r\n<p><strong>Changes to this privacy policy:</strong>&nbsp;RROSDAILY&nbsp; shall update this privacy policy at its sole discretion, the date of updation would reflect on this page. Users are advised to check this page for any changes in the privacy policy and to stay informed about how the personal information of the Users is protected by us. The User/s hereby acknowledge/s and agree/s that it is their responsibility to review this privacy policy periodically and become aware of modifications.</p>\r\n\r\n<p><strong>Your acceptance of rrosdaily&#39;s terms:</strong>&nbsp;By using this application and Site, the Users signify their acceptance of this policy as may be modified from time to time. The Users are advised not to access this application or site if they do not agree to our privacy policy. The above-mentioned privacy policy shall be applicable for the information and data collected by our call centres as well.</p>\r\n\r\n<p><strong>Contact us:</strong>&nbsp;If you have any questions about this Privacy Policy, the practices of this site, or your dealings with this site or to correct or update any information you have provided; you can send an e-mail to us.</p>\r\n', '2022-01-24'),
(1, 4, 'Return & Refund Policy', '<p>RROSDAILY&nbsp;has &nbsp;&lsquo;no question asked&rsquo; return policy if you are not satisfied with the quality of the products delivered to you. You can either return the products to the delivery personnel at the time of delivery or you can contact our customer support team and we will do the needful.</p>\r\n\r\n<p>We want you to be happy with your purchase. If you&rsquo;re dissatisfied with an item, please return it, complete register receipt for a refund or exchange.</p>\r\n\r\n<p>All claims must be made to our customer service department within 24 hour of delivery. We request that the damaged items received be returned to us with original manufacturer&rsquo;s/supplier&rsquo;s packing. We will refund to your account if&nbsp;the same items are not available.</p>\r\n\r\n<p>To request a return, contact us on Application or mail our Customer Support at email. Please provide the following information in your email: customer name, order number, product name (product description) in question, and the nature of the problem. Customer would be contacted with return authorization and notify further process.</p>\r\n\r\n<p>Thank you for shopping at&nbsp;<strong>https://www.rrosdaily.com</strong></p>\r\n\r\n<p>If, for any reason, You are not completely satisfied with a purchase, we invite You to review our Policy.&nbsp;</p>\r\n\r\n<p>The following terms are applicable for any products that you purchased with us.</p>\r\n\r\n<p><strong>INTERPRETATION AND DEFINITIONS</strong></p>\r\n\r\n<p><strong>&nbsp;</strong><strong>Interpretation</strong></p>\r\n\r\n<p>The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</p>\r\n\r\n<h3><strong>Definitions</strong></h3>\r\n\r\n<p>For the purposes of this Return and Exchange Policy:</p>\r\n\r\n<p><strong>Individual</strong>&nbsp;(referred to as either &quot;the Company&quot;, &quot;We&quot;, &quot;Us&quot; or &quot;Our&quot; in this Agreement) refers to&nbsp;<strong>RROSDAILY</strong>&nbsp;Located at&nbsp;<strong>IN</strong>.</p>\r\n\r\n<p><strong>Goods</strong>&nbsp;refer to the items offered for sale on the Service.</p>\r\n\r\n<p><strong>Orders</strong>&nbsp;mean a request by You to purchase Goods from Us.</p>\r\n\r\n<p><strong>Service</strong>&nbsp;refers to the Website.</p>\r\n\r\n<p><strong>Website</strong>&nbsp;refers to My Site, accessible from&nbsp;<strong>https://www.rrosdaily.com</strong></p>\r\n\r\n<p><strong>You</strong>&nbsp;means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</p>\r\n\r\n<h2><strong>GENERAL RETURN POLICY</strong></h2>\r\n\r\n<p>We want you to be happy with your purchase. If you are not completely satisfied, you can return the product to us and we will either repair/replace it, or credit your account. You are eligible for a<strong>&nbsp;REFUND or EXCHANGE</strong>&nbsp;which are subject to the below terms:</p>\r\n\r\n<p>If the product you have received which turns out to be defective or otherwise of poor quality (save for direct warranty products which are discussed below), please notify us as soon as reasonably possible after you become aware of the defect or poor quality.</p>\r\n\r\n<p>Products that are bought from the&nbsp;<strong>Physical Stores can&rsquo;t be returned.&nbsp;</strong>All Items are eligible for return and would be processed if conditions are met.</p>\r\n\r\n<p><strong>REFUND POLICY</strong></p>\r\n\r\n<p>In order to be eligible for a refund, you have to return the goods within&nbsp;<strong>7</strong>&nbsp;days of your purchase.&nbsp;If the product is damaged in any way, or you have initiated the return after&nbsp;<strong>7</strong>&nbsp;days have passed, you will not be eligible for a refund.</p>\r\n\r\n<ul>\r\n	<li><strong>Product must be returned in its original packaging</strong></li>\r\n	<br />\r\n	<li><strong>Product wasn&#39;t used or damaged</strong></li>\r\n	<br />\r\n	<li><strong>Product must include original tags (if applicable)</strong></li>\r\n	<br />\r\n	<li><strong>Product must have the receipt or proof of purchase</strong></li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><strong>Product wasn&#39;t used or damaged</strong></li>\r\n	<br />\r\n	<li><strong>Product must include original tags (if applicable)</strong></li>\r\n	<br />\r\n	<li><strong>Product must have the receipt or proof of purchase</strong></li>\r\n</ul>\r\n\r\n<p>After we receive your product, our team of professionals will inspect it and process your refund. The money will be refunded to the&nbsp;<strong>Original Payment Method</strong>&nbsp;you&rsquo;ve used during the purchase.</p>\r\n\r\n<p><strong>EXCHANGE POLICY</strong></p>\r\n\r\n<p>Product can be exchanged for a different size or color variation, provided that such variation is available. Customers are allowed to exchange for item within&nbsp;<strong>7&nbsp;</strong>days. Exchanges exceeding&nbsp;<strong>7&nbsp;</strong>days will not be processed.</p>\r\n\r\n<p>In order to be eligible for exchanges make sure that these following conditions are met:</p>\r\n\r\n<ul>\r\n	<li><strong>Product must be returned in its original packaging</strong></li>\r\n	<br />\r\n	<li><strong>Product wasn&#39;t used or damaged</strong></li>\r\n	<br />\r\n	<li><strong>Product must include original tags (if applicable)</strong></li>\r\n	<br />\r\n	<li><strong>Product must have the receipt or proof of purchase</strong></li>\r\n</ul>\r\n\r\n<p>You are&nbsp;<strong>required to ship back</strong>&nbsp;the product for the item to be inspected and replaced.</p>\r\n\r\n<p>You exchanged product will be processed&nbsp;<strong>Once items are received and conditions confirmed</strong>.</p>\r\n\r\n<p>You are given the rights to exchange the item,&nbsp;<strong>One time.&nbsp;</strong>Provided that all conditions in Exchange Policy are met.</p>\r\n\r\n<p>Unfortunately, product that were marked as a gift when purchased is&nbsp;<strong>not allowed</strong>&nbsp;to be&nbsp;<strong>Returned or Exchanged.</strong></p>\r\n\r\n<p>If the product were marked as a Bundled when purchased, there some conditions to be followed for it to be eligible for exchange:</p>\r\n\r\n<p><strong>HOW TO INITIATE A RETURN</strong></p>\r\n\r\n<p>If you have a request for Return, Refund or Exchange and if you have further clarification and questions, Please do not hesitate to contact us through our:</p>\r\n\r\n<p>Self-Service Portal:&nbsp;<strong>https://www.rrosdaily.com</strong></p>\r\n\r\n<p>Contact Form URL:&nbsp;<strong>https://www.rrosdaily.com</strong></p>\r\n\r\n<p>Phone Number:&nbsp;<strong>9911332734</strong></p>\r\n\r\n<p>You will be updated for their Return Status through their<strong>&nbsp;EMAIL</strong>&nbsp;and&nbsp;<strong>SMS</strong>&nbsp;provided that all contact information is recorded to us.</p>\r\n', '2022-01-24'),
(1, 5, 'Shipping Policy', '<p>RROSDAILY (&quot;we&quot; and &quot;us&quot;) is the operator of (https://www.rrosdaily.com) (&quot;Website&quot;). By placing an order through this Website you will be agreeing to the terms below. These are provided to ensure both parties are aware of and agree upon this arrangement to mutually protect and set expectations on our service.</p>\r\n\r\n<p><strong>1. General</strong></p>\r\n\r\n<p>Subject to stock availability. We try to maintain accurate stock counts on our website but from time-to-time there may be a stock discrepancy and we will not be able to fulfill all your items at time of purchase. In this instance, we will fulfill the available products to you, and contact you about whether you would prefer to await restocking of the backordered item or if you would prefer for us to process a refund.</p>\r\n\r\n<p><strong>2. Shipping Costs</strong></p>\r\n\r\n<p>Shipping costs are calculated during checkout based on weight, dimensions and destination of the items in the order. Payment for shipping will be collected with the purchase.</p>\r\n\r\n<p>This price will be the final price for shipping cost to the customer.</p>\r\n\r\n<p><strong>3. Returns</strong></p>\r\n\r\n<p><strong>3.1 Return Due To Change Of Mind</strong></p>\r\n\r\n<p>RROSDAILY will happily accept returns due to change of mind as long as a request to return is received by us within 7 days of receipt of item and are returned to us in original packaging, unused and in resellable condition.</p>\r\n\r\n<p>Return shipping will be paid at the customers expense and will be required to arrange their own shipping.</p>\r\n\r\n<p>&nbsp;Once returns are received and accepted, refunds will be processed to store credit for a future purchase. We will notify you once this has been completed through email.</p>\r\n\r\n<p>&nbsp;(RROSDAILY) will refund the value of the goods returned but will NOT refund the value of any shipping paid.</p>\r\n\r\n<p><strong>3.2 Warranty Returns</strong></p>\r\n\r\n<p>RROSDAILY will happily honor any valid warranty claims, provided a claim is submitted within 90 days of receipt of items.</p>\r\n\r\n<p>Customers will be required to pre-pay the return shipping, however we will reimburse you upon successful warranty claim.</p>\r\n\r\n<p>Upon return receipt of items for warranty claim, you can expect RROSDAILY to process your warranty claim within 7 days.</p>\r\n\r\n<p>Once warranty claim is confirmed, you will receive the choice of:</p>\r\n\r\n<p>(a) refund to your payment method</p>\r\n\r\n<p>(b) a refund in store credit</p>\r\n\r\n<p>(c) a replacement item sent to you (if stock is available)</p>\r\n\r\n<p><strong>4. Delivery Terms</strong></p>\r\n\r\n<p><strong>4.1 Transit Time Domestically</strong></p>\r\n\r\n<p>In general, domestic shipments are in transit for 2 - 7 days</p>\r\n\r\n<p><strong>4.2 Transit time Internationally</strong></p>\r\n\r\n<p>Generally, orders shipped internationally are in transit for 4 - 22 days. This varies greatly depending on the courier you have selected. We are able to offer a more specific estimate when you are choosing your courier at checkout.</p>\r\n\r\n<p><strong>4.3 Dispatch Time</strong></p>\r\n\r\n<p>Orders are usually dispatched within 2 business days of payment of order</p>\r\n\r\n<p>Our warehouse operates on Monday - Friday during standard business hours, except on national holidays at which time the warehouse will be closed. In these instances, we take steps to ensure shipment delays will be kept to a minimum.</p>\r\n\r\n<p><strong>4.4 Change Of Delivery Address</strong></p>\r\n\r\n<p>For change of delivery address requests, we are able to change the address at any time before the order has been dispatched.</p>\r\n\r\n<p><strong>4.5 P.O. Box Shipping</strong></p>\r\n\r\n<p>RROSDAILY will ship to P.O. box addresses using postal services only. We are unable to offer couriers services to these locations.</p>\r\n\r\n<p><strong>4.6 Military Address Shipping</strong></p>\r\n\r\n<p>We are able to ship to military addresses using USPS. We are unable to offer this service using courier services.</p>\r\n\r\n<p>&nbsp;<strong>4.7 Items Out Of Stock</strong></p>\r\n\r\n<p>If an item is out of stock, we will cancel and refund the out-of-stock items and dispatch the rest of the order.</p>\r\n\r\n<p><strong>4.8 Delivery Time Exceeded</strong></p>\r\n\r\n<p>If delivery time has exceeded the forecasted time, please contact us so that we can conduct an investigation</p>\r\n\r\n<p><strong>5. Tracking Notifications</strong></p>\r\n\r\n<p>Upon dispatch, customers will receive a tracking link from which they will be able to follow the progress of their shipment based on the latest updates made available by the shipping provider.</p>\r\n\r\n<p><strong>6. Parcels Damaged In Transit</strong></p>\r\n\r\n<p>If you find a parcel is damaged in-transit, if possible, please reject the parcel from the courier and get in touch with our customer service. If the parcel has been delivered without you being present, please contact customer service with next steps.</p>\r\n\r\n<p><strong>7. Duties &amp; Taxes</strong></p>\r\n\r\n<p><strong>7.1 Sales Tax</strong></p>\r\n\r\n<p>Sales tax has already been applied to the price of the goods as displayed on the website</p>\r\n\r\n<p><strong>7.2 Import Duties &amp; Taxes</strong></p>\r\n\r\n<p>Import duties and taxes for international shipments will be pre-paid, without any additional fees to be paid by customer upon arrival in destination country</p>\r\n\r\n<p><strong>8. Cancellations</strong></p>\r\n\r\n<p>If you change your mind before you have received your order, we are able to accept cancellations at any time before the order has been dispatched. If an order has already been dispatched, please refer to our refund policy.</p>\r\n\r\n<p><strong>9. Insurance</strong></p>\r\n\r\n<p>Parcels are insured for loss and damage up to the value as stated by the courier.</p>\r\n\r\n<p><strong>9.1 Process for parcel damaged in-transit</strong></p>\r\n\r\n<p>We will process a refund or replacement as soon as the courier has completed their investigation into the claim.</p>\r\n\r\n<p><strong>9.2 Process for parcel lost in-transit</strong></p>\r\n\r\n<p>We will process a refund or replacement as soon as the courier has conducted an investigation and deemed the parcel lost.</p>\r\n\r\n<p><strong>10. Customer service</strong></p>\r\n\r\n<p>For all customer service enquiries, please submit an enquiry at https://www.rrosdaily.com</p>\r\n', '2022-01-24'),
(1, 6, 'Terms & Conditions', '<p>This Website and Apps are operated by RROSDAILY. It is strongly recommended that you read and understand these &lsquo;Terms of Use&rsquo; carefully, as by accessing this site.You agree to be bound by the same and acknowledge that it constitutes an agreement between you and the Company (hereinafter the &ldquo;User Agreement&rdquo;). You should not use the Website if you have any objections to any of these Terms &amp; Conditions.</p>\r\n\r\n<p><br />\r\nThese Terms &amp; Conditions apply to your use of this Website and also apply to:<br />\r\n(a) All websites and Apps (Both IOS and Android) owned and/or provided by RROSDAILY, including without limitation websites and all services offered on or through this Website or any&nbsp;RROSDAILY website (&ldquo;Services&rdquo;)<br />\r\n(b) All software offerings and applications owned or provided by RROSDAILY&nbsp;and/or available on or through this Website or any&nbsp;RROSDAILY website (&ldquo;Software&rdquo;)<br />\r\n(c) Web pages, data, text, images, photographs, graphics, audio, video, and documents including, without limitation, offers and coupons, gift cards, marketing materials, press releases, and other information and content available on or through or submitted on or through this Website or any&nbsp;RROSDAILY website<br />\r\n(d) All social media pages operated by RROSDAILY, regardless of whether available on a&nbsp;RROSDAILY owned site or a site owned by a third party (Instagram, Twitter, Facebook, Blogs, etc.).By accessing the Website, you acknowledge that you have read and understand these Terms &amp; Conditions, accept them, and agree to be legally bound by them.</p>\r\n\r\n<p><br />\r\nRROSDAILY&nbsp;may revise these Terms &amp; Conditions and the Privacy Policy over time as new features are added to the Website or as Internet law and standards evolve. We will post these changes but recommend that you read these Terms &amp; Conditions periodically when you visit the Website.</p>\r\n\r\n<p><br />\r\nYour continued participation on this Website indicates your acceptance of these Terms &amp; Conditions, including your acceptance of the Privacy Policy and of the collection, use, disclosure, management and storage of your Personal Information (as defined in the Privacy Policy).</p>\r\n\r\n<p><br />\r\nIf you have any objections to any of these Terms &amp; Conditions, you should immediately discontinue use of the Website.</p>\r\n\r\n<p><br />\r\nOther Terms: Some areas of this Website may have additional rules, guidelines, and/or other terms and conditions that apply to your access and/or use of that area of the Website and that may be revised from time to time (&ldquo;Other Terms&rdquo;). If there is a conflict or inconsistency between any of these Terms &amp; Conditions and the Other Terms, the Other Terms shall take precedence with respect to your access and use of that area of the Website.<br />\r\nCopyright and Permissions: Please feel free to browse the Website. In general, and unless otherwise posted, you may review and print copies of material from the Website, provided that the material<br />\r\n(1) is used only for non-commercial purposes, and<br />\r\n(2) retains, without alteration, all copyright, trademark, and other proprietary notices displayed on the material as posted on the Website.</p>\r\n\r\n<p><br />\r\nYou are not permitted to make or distribute copies of material on the Website for any commercial purpose without prior written permission from RROSDAILY. None of the material contained on the Website (including all software, HTML code, and other code) may be reverse-engineered, disassembled, decompiled, transcribed, stored in a retrieval system, translated into any language or computer language, retransmitted in any form or by any means (electronic, mechanical, photo-reproduction, recordation, or otherwise), resold or redistributed without the prior written permission of RROSDAILY. Except as otherwise noted.</p>\r\n\r\n<p>All content of the Website is: Copyright &copy;2020 RROSDAILY.com All rights reserved. RROSDAILY has a policy of terminating services to users who intentionally and/or repeatedly infringe. For further information regarding permission to use material from the Website, please contact us at email.</p>\r\n', '2022-01-24');
