(1, 'MSME INDIA BUSINESS CONVENTION 2022', '1640759652slide5.png,1640759652slide4.png,1640759654slide3.png,1640759655slide2.jpg,1640759655slide1.jpg', '2022-01-05', '2022-01-07', 'Indian Business Convention', 'MSME India Business Convention &ndash; a combination of conference, exhibition and awards that intends to showcase the growing opportunities in the MSMEs, while highlighting their role and resilience in these challenging times\r\n\r\nMSMEs, often touted as the backbone of Indian economy, play an integral role in Indian economic growth and prosperity. Their contribution, in terms of generating employment, encouraging the entrepreneurial spirit and innovation, has been crucial in fostering competitiveness in the country&rsquo;s economy.&nbsp;\r\n', '', NULL, '2021-12-29 06:34:15', NULL, '0000-00-00 00:00:00'),
(2, 'MSMECCII GLOBAL CONFERENCE, EXHIBITION & BUSINESS EXCELLENCE AWARD', '1641811087Banner.jpg', '2022-04-25', '2022-04-28', 'Physically & Virtually', 'This is to inform you that MSME Chamber of Commerce and Industry of India &amp; National Productivity Council(Under Ministry of Commerce &amp; Industry) Jointly organizing Global Conference, Asia Greentech Exhibition &amp; Asia&rsquo;s Largest Award show&nbsp;(Golden, Platinum &amp; Diamond Business Excellence Awards, Make in India Initiative Award, Ganesh Bharat Ratan Award)&nbsp;on Plastics Recycling, Waste Management, Pollution Control, Biogas, Non Ferrous Metals &amp; Scrap Recycling, Automobile, Glass, E-waste, Battery Recycling, Flexible Packaging, Adhesives, Environment, Climate Change, Electrical Vehicles from 17th - 20th January 2022 at Vigyan Bhavan, New Delhi.\r\n', '1641810302aditya_birla_health.pdf', NULL, '2021-12-29 10:32:29', NULL, '0000-00-00 00:00:00'),
(6, 'BUSINESS EVENTS', '1641557054slide5.png,1641557054slide4.png,1641557056slide3.png', '2022-01-08', '2022-01-10', 'dsfadsa', 'dasgsafsd\r\n', '1641557054', NULL, '2022-01-07 12:04:18', NULL, '0000-00-00 00:00:00');
