INSERT INTO `event_award_details` (`OVERVIEW_ID`, `AWARD_OVERVIEW`, `AWARD_TERMS_CONDITION`, `EVENT_ID`, `CREATION_DATE`) VALUES
(1, '<p><strong>MSME Chamber of Commerce and Industry of India &amp; National Productivity Council (Under Ministry of Commerce and Industry Govt of India) Presents:-</strong></p>\r\n\r\n<p><em><strong>Following very prestigious Award:-</strong></em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1.Golden Business Excellence Award</p>\r\n\r\n<p>2.Platinum Business Excellence Award</p>\r\n\r\n<p>3.Diamond Business Excellence Award</p>\r\n\r\n<p>4.Ganesh Bharat Ratna Award</p>\r\n\r\n<p>5.Life Time Achievement Award</p>\r\n\r\n<p>6.Make in India Initiative Award</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>MSMECCII are working on 53 different Sector as under and every sector are having 10-12 awards depending on their personal &amp; organization achievement and all awards will be scrutinised / approved by the Jury only.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Prestigious Award will be given for the encouragement &amp; boosting of MSMEs, SMEs &amp; large corporate organization</p>\r\n', '<p><strong>Awards rule and Regulations </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>For all the payments, GST @ 18.00 % will be charged.</li>\r\n	<li>Onsite Assessment, Lodging-Boarding and Travel expenses&nbsp; will be bourn by the Awardees as only.</li>\r\n	<li>Award Ceremony Nomination Fees will be deposited with the Nomination form duly filled.</li>\r\n	<li>Awards Kit will be provided And Logo will be promoted.</li>\r\n	<li>Awards Schedule dates can be changed if&nbsp; Corona/ Floods/ War or any other reasons which will be beyond our organizations Control Nomination fees will not be refunded but will carry forward for the next available date.</li>\r\n	<li>If anyone will not be able to attend the events and requested for courier services, that can be arranged but courier cost to be provided by the awardee.</li>\r\n</ul>\r\n\r\n<p><strong>Refunded Policy:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>If your application doesn&#39;t qualify for the winner&#39;s list, complete fees will be refunded by our accounts department.</li>\r\n	<li>If your applicant fails because of not providing the required documents to our support audit team, no refund will be provided</li>\r\n	<li>Once the Awards are approved &amp; booked, then it will be non-refundable.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 2, '2022-01-08 00:21:38');
