INSERT INTO `sms_events` (`ID`, `TITLE`, `DATE`, `MESSAGE`, `FILE_NAME`, `FILE_PATH`, `STATUS`) VALUES
(5, 'CULTRUAL PROGRAM ON 15 AUGUST', '2022-08-15', 'Cultural programmes play a major part in a school student\'s life. By taking part in the programmes, right from an early age, children come to know about the rich culture and traditions being followed which also develops their interpersonal skills.', 'Independence_wishes.png', 'public/files/1y2c9wwQwCuTPrWC4HclbxLfHEvWWGjnA03QJP8z.png', 'Active'),
(6, 'CULTRUAL PROGRAM ON 19 AUGUST', '2022-08-15', 'India is the land of festivals and Janmashtami is one of the most popular and vibrant among all. It is an annual Hindu celebration held during the monsoons. Krishna Janmashtami, Krishnashtami, Sri Krishna Jayanti, Gokulashtami, or simply Janmashtami commemorates the birth of Lord Krishna, the eighth avatar or incarnation of Lord Vishnu. This makes the day a landmark for followers of the Vaishnavism tradition of Hinduism.', '15aug.jpg', 'public/files/3POCm6rod5dvqAw4vgB0ZB66Gb1H5RjriMcUG4rG.jpg', 'Active');
