(1, 'NOTICE TEST', '2022-07-17', 'Now, create directory name files inside storage/app/public directory. Because the following line of code will upload an file into the files directory, which is located inside storage/app/public/ directory:', 'logo1.JPG', 'public/files/0jHZYUcSGQk3e0dFWyuQToOzBxJG7FerjoFTGMFg.jpg', 'Active'),
(2, 'TEST NOTICE AGAIN', '2022-07-17', 'I am creating custom validation for two fields, url and attachment fields. I am trying to validate that only one field is to be required from both but when user fill both fields he can get error to fill only anyone field.', 'service_03.jpg', 'public/files/CQTlK8z9p5TqrnVKQv48P8E1ils4D7cIBw63bEdV.jpg', 'Deactive'),
(3, 'TEST NOTICE ONCE', '2022-07-17', 'I am creating custom validation for two fields, url and attachment fields. I am trying to validate that only one field is to be required from both but when user fill both fields he can get error to fill only anyone field.', 'pass_logo.png', 'public/files/orxg0PpXLTgAPbTumMd0zyy6rnOew8QQ1ufbB2kV.png', 'Active'),
(4, 'TEST NOTICE ONLY', '2022-07-17', 'I am creating custom validation for two fields, url and attachment fields. I am trying to validate that only one field is to be required from both but when user fill both fields he can get error to fill only anyone field.', 'logo1_1.png', 'public/files/Sn2lzFB0ShXkRpNozNqC66VVpLFPrQe2dung9sb9.png', 'Deactive'),
(5, 'CULTURAL PROGRAM ON 15 AUGUST', '2022-08-15', 'Cultural programmes play a major part in a school student\'s life. By taking part in the programmes, right from an early age, children come to know about the rich culture and traditions being followed which also develops their interpersonal skills.', 'Independence_wishes.png', 'public/files/N1oXYteMFgGaBF72xqYIJOx7aRUGRLAo7zuSO287.png', 'Deactive'),
(6, 'CULTURAL PROGRAM ON 15 AUGUST', '2022-08-15', 'Cultural programmes play a major part in a school student\'s life. By taking part in the programmes, right from an early age, children come to know about the rich culture and traditions being followed which also develops their interpersonal skills.', NULL, NULL, 'Deactive'),
(7, 'CULTURAL PROGRAM ON 15 AUGUST', '2022-08-15', 'Cultural programmes play a major part in a school student\'s life. By taking part in the programmes, right from an early age, children come to know about the rich culture and traditions being followed which also develops their interpersonal skills.', NULL, NULL, 'Deactive'),
(8, '15 AUGUST NOTICES', '2022-08-13', '<h2>Dear students,</h2>\r\n\r\n<h2>we are going to organise an Independence Day Celebration, on 15/7/&hellip; All the childrens are requested to come to school. We will have a flag hoisting ceremony at 8: 00 am in the morning. We will have our assembly followed by the flag hoisting ceremony. We will have a small function of patriotic songs and dances. Interested students can give their names for participation. No books Tiffin boxes are required. Parents need to collect their child by 11 am. For further details parents will be given a letter informing the details.</h2>\r\n\r\n<h2>Regards</h2>\r\n\r\n<h2><strong>INDIAN PUBLIC SCHOOL</strong></h2>\r\n\r\n<h2>SINGHPUR ORIYA</h2>\r\n\r\n<h2>BARHI HAZARIBAGH</h2>', 'sir vijsa.jpeg', 'public/files/aj99PzQUrttFclus0x3gUaZzooifn3PPrNjhQlDi.jpg', 'Active'),
(9, 'THIS IS DEMO NOTICE', '2022-12-16', '<p>Dear Student,</p>\r\n\r\n<p>This is demo notice to check notice data</p>', '', '', 'Active'),
(10, 'THIS IS TEST NOTICE', '2022-12-17', '<p>Dear Student,</p>\r\n\r\n<p>This is test notice</p>', 'offer_sms.jpg', 'public/files/LAuzDtFr29uhj6CDEt3x02atbq059CVmZDdZWObt.jpg', 'Active'),
(11, 'DEMO', '2023-01-18', '<p>test</p>', '', '', 'Active');
