(1, 'WHAT IS PHP', 'Three letters that together constitute the name of one of the world\'s most popular programming language for .......', 'http://www.softdevloper.com/blog_php/blogs_posts.php', 'WHAT IS PHP', '<h1 class=\"text-center text-danger\">What Is PHP?</h1>\r\n      <p>\r\n         <h5><strong>Th</strong>ree letters that together constitute the name of one of the world\'s most popular programming languages for we development.</h5> \r\n      </p>\r\n      <ul style=\"color: black;\">\r\n        <li>PHP stands for PHP : Hypertext Preprocessor.</li>\r\n        <li>PHP is a widely-used, open source scripting language.</li>\r\n        <li>PHP scripts are executed on the server.</li>\r\n        <li>PHP is free to download and use.</li>\r\n        <li>PHP is a server side scripting language used to developed attractive and dynamic web pages.</li>\r\n        <li>PHP is a pwerful tool for making dynamic and iteractive wen pages.</li>\r\n        <li>PHP is the widely-used, free, and efficient alternative to competitors such as Microsoft\'s ASP.</li>\r\n      </ul>\r\n      <h1 class=\"text-center text-danger\">Advantage Of PHP?</h1>\r\n      <p>\r\n         <h5><strong>If</strong> you know the other <label>server side</label> language like ASP.NET or JSP, you might be wondering what takes PHP so special or so different from these <label>Competing</label> alternatives.</h5>\r\n         \r\n         <ul style=\"color: black;\">\r\n        <li><u><label>Performance</label></u><br/>\r\n        <strong>S</strong>cripts written in php executes faster than those written in other scripting language.\r\n        </li>\r\n        <li><u><label>Open Source Software (OSS)</label></u><br/>\r\n        <strong>PHP\'s</strong> source codes are freely available on the web. It may be used without paying any licensing fee, free download all version.</li>\r\n        <li><u><label>Platform independent</label></u><br/>\r\n        <strong>PHP</strong> is available for UNIX, Microsoft Windows, Mac Operating System.<br/>\r\n        PHP programs are protable between platforms. As a result PHP application developed on windows will run on UNIX without any significant issues.\r\n        </li>\r\n        \r\n        <li><u><label>Platform independent</label></u><br/>\r\n        <strong>PHP</strong> is available for UNIX, Microsoft Windows, Mac Operating System.<br/>\r\n        PHP programs are protable between platforms. As a result PHP application developed on windows will run on UNIX without any significant issues.\r\n        </li>\r\n        <li><u><label>Database Support</label></u><br/>\r\n        <strong>PHP</strong> supports all most databse like Oracle, Mysql, SQL Server, Sql Lite etc.\r\n        </li>\r\n        <li><u><label>All Web Server Support</label></u><br/>\r\n        <strong>PHP</strong> support all web server like Apache, Tomcat, IIS etc.\r\n        </li>\r\n        <li><u><label>OOPS Support</label></u><br/>\r\n        <strong>PHP</strong> support Oops Concept.\r\n        </li>\r\n        <li><u><label>Run On Low Configuration</label></u><br/>\r\n        <strong>PHP</strong> Support low configuration machine like P3 system.\r\n        </li>\r\n        <li><u><label>Light Weight Software</label></u><br/>\r\n        <strong>PHP\'s</strong> software are light weight maximum cover (20-30)MB and install all the related software. \r\n        </li>\r\n      </ul>\r\n      <h5>HTML is embedded with PHP. PHP is easy to developed and easy to understand.</h5>\r\n      <p><h3 class=\"text-center text-success\"><a href=\"../blogs.php\">Thank You</a></h3></p>', 'ABHAY PRATAP SRIVASTAVA', '2021-09-28', 'PROGRAMING', 'PHP'),
(2, 'HOW TO INSTALL WAMP', 'Here I am describing steps to install wamp software step by step. Please Follow these steps to ......', 'http://www.softdevloper.com/blog_php/blogs_posts.php', 'HOW TO INSTALL WAMP', '<h1 class=\"text-center text-danger\">How To Install Wamp Software?</h1>\r\n    <p><h5><label>Step-01.</label> (Download latest wamp software as per your systemt configuration Like {64 bit for 64 bie os and 32 bit for 32 bit os}, i am giving official link to download the latest wamp software)</h5></p>\r\n    <h3><a href=\"https://www.wampserver.com/en/\" class=\"btn btn-primary\">Download Latest Software</a></h3>\r\n    <p><h5><label>step-02.</label> After Downloading Setup if setup will be in zip file than first extract zip file then -> click on setup</h5></p>\r\n    <p><h5><label>step-03.</label> -> click on Next.</h5></p>\r\n    <p><h5><label>step-04.</label> -> Next window you will see is about the license agreement. Click on the â€œI accept the agreementâ€ radio button and then the â€œNextâ€ button.</h5></p>\r\n    <img src=\"img_blog/wamp1.jpg\" alt=\"Wamp Software Installation\"/>\r\n    \r\n    <p><h5><label>step-05.</label> -> The next screen will inform you about the required components that have to be present in your computer system for the proper functioning of the WampServer. Click on the Next</h5></p>\r\n    <img src=\"img_blog/wamp2.jpg\" alt=\"Wamp Server Installation\"/>\r\n    \r\n     <p><h5><label>step-06.</label> -> Select Location/Destination to Install WAMP. Click on the Next</h5></p>\r\n    <img src=\"img_blog/wamp3.jpg\" alt=\"Wamp Software Installation\"/>\r\n    \r\n    <p><h5><label>step-07.</label> -> Select Start Menu Folder to Install WAMP. Click on the Next</h5></p>\r\n    <img src=\"img_blog/wamp4.jpg\" alt=\"Wamp server Installation\"/>\r\n    \r\n    <p><h5><label>step-08.</label> -> Ready to Install WAMP. Click on the Install</h5></p>\r\n    <img src=\"img_blog/wamp5.jpg\" alt=\"Wamp Software Installation\"/>\r\n    <p><h5>Now, just be patient as the WampServer is extracting files to your selected location. Let the process complete.</h5></p>\r\n    <img src=\"img_blog/wamp6.jpg\" alt=\"Wamp server Installation\"/>\r\n    <p><h5>Once the status bar is turned fully green, an information screen will appear. Click on the Next</h5></p>\r\n    \r\n    <p><h5><label>step-09.</label> -> WAMPInstallation Complete. Click on the Finish</h5></p>\r\n    <img src=\"img_blog/wamp7.jpg\" alt=\"Wamp Software Installation\"/>\r\n    \r\n    <h3>Conclusion</h3>\r\n    <p><h5>If you have completed the above-mentioned steps carefully, I assure you wonâ€™t face any trouble in installing of WAMP software. And once you are done with your project testing you can easily make it live</h5></p>\r\n    \r\n    <p><h3 class=\"text-center text-success\"><a href=\"../blogs.php\">Thank You</a></h3></p>', 'ABHAY PRATAP SRIVASTAVA', '2021-09-28', 'PROGRAMING', 'PHP'),
(3, 'HOW TO INSTALL XAMPP', 'How To Install xampp Software? (For Windows Operating System)', 'http://www.softdevloper.com/blog_php/blogs_posts.php', 'HOW TO INSTALL XAMPP', '<h1 class=\"text-center text-danger\">How To Install xampp Software?</h1>\r\n    <p><h5><label>Step-01.</label> (Download latest xampp software as per your systemt configuration Like {64 bit for 64 bie os and 32 bit for 32 bit os}, i am giving official link to download the latest xampp software)</h5></p>\r\n    <h3><a href=\"https://www.apachefriends.org/download.html\" class=\"btn btn-primary\">Download Latest XAMPP Software</a></h3>\r\n    <p><h5><label>step-02.</label> After Downloading Setup if setup will be in zip file than first extract zip file then -> click on setup</h5></p>\r\n    <p><h5><label>step-03.</label> -> click on Next.</h5></p>\r\n    \r\n    <p><h5><label>step-04.</label> -> Click to Allow access or deactivate the firewall and any other antivirus software because it can hamper the process of installation.</h5></p>\r\n    <img src=\"img_blog/xampp1.png\" alt=\"XAMPP Software Installation\"/>\r\n    <p><h5><label>step-05.</label> -> Just before the installation, a pop-up window appears with a warning to disable UAC.</h5></p>\r\n    <img src=\"img_blog/xampp2.png\" alt=\"XAMPP server Installation\"/>\r\n    \r\n    <p><h5><label>step-06.</label> -> The next window will XAMPP setup wizard opens spontaneously. Click on \"NEXT\" to start the configuration of the settings.</h5></p>\r\n    <img src=\"img_blog/xampp3.png\" alt=\"XAMPP Software Installation\"/>\r\n    \r\n     <p><h5><label>step-07.</label> -> After that, a \'Select Components\' panel appears, To get a complete localhost server, it is recommended to install using the default options of containing all available components. Click NEXT to proceed further.</h5></p>\r\n    <img src=\"img_blog/xampp4.png\" alt=\"XAMPP server Installation\"/>\r\n    \r\n    <p><h5><label>step-08.</label> -> The setup is now ready to install. Click NEXT to take the process forward.</h5></p>\r\n    <img src=\"img_blog/xampp5.png\" alt=\"XAMPP Software Installation\"/>\r\n    \r\n    <p><h5><label>step-09.</label> -> Select the location where the XAMPP software packet needs to be installed. Click NEXT to take the process forward.</h5></p>\r\n    <img src=\"img_blog/xampp6.png\" alt=\"XAMPP server Installation\"/>\r\n    <p><h5>Now, just be patient as the XAMPPServer is extracting files to your selected location. Let the process complete.</h5></p>\r\n    <img src=\"img_blog/xampp7.png\" alt=\"XAMPP Software Installation\"/>\r\n    <p><h5>Once the status bar is turned fully green, an information screen will appear. Click on the Next</h5></p>\r\n    \r\n    <p><h5><label>step-10.</label> -> XAMPP Installation Complete. Click on the Finish</h5></p>\r\n    <img src=\"img_blog/xampp8.png\" alt=\"XAMPP server Installation\"/>\r\n    <p><h5><label>step-11.</label> -> After Clicking on finish the next window will appeat automatically</h5></p>\r\n    <img src=\"img_blog/xampp9.png\" alt=\"XAMPP Software Installation\"/>\r\n    \r\n    <h3>Conclusion</h3>\r\n    <p><h5>If you have completed the above-mentioned steps carefully, I assure you wonâ€™t face any trouble in installing of xampp software. And once you are done with your project testing you can easily make it live</h5></p>\r\n    \r\n    <p><h3 class=\"text-center text-success\"><a href=\"../blogs.php\">Thank You</a></h3></p>', 'ABHAY PRATAP SRIVASTAVA', '2021-09-28', 'PROGRAMING', 'PHP'),
(4, 'HOW TO WRITE PHP CODE OR SYNTAX.', 'How To Write PHP Code Or Syntax? Here You Can Find.', 'http://www.softdevloper.com/blog_php/blogs_posts.php', 'HOW TO WRITE PHP CODE OR SYNTAX.', '<h1 class=\"text-center text-danger\">How To Write PHP Code Or Syntax?</h1>\r\n      \r\n     <p><h5><strong>In</strong> PHP echo and print keyword is used to print the statement</h5></p>\r\n     <p><h5><strong>Difference between echo and print in PHP</strong><br/>\r\n     <ul>\r\n         <li>echo is a statement i.e used to display the outpue. It can be used with parentheses echo() or without parentheses but within double quote or single qoute like echo \"\"; or echo \'\';. After Completed of statement it must be terminated with semicolun (;). </li>\r\n         <li>echo is faster then print keyword.</li>\r\n         <li>Using echo can pass multiple string seperated as (,).</li>\r\n         <li>echo doesn\'t return any value.</li>\r\n     </ul>\r\n     </h5></p>\r\n     <?php show_source(\'syntax_txt/example1.txt\'); ?>\r\n     <p><h5><strong>Pass multiple strings</strong></h5></p>\r\n     <?php show_source(\'syntax_txt/example2.txt\'); ?>\r\n     \r\n      <p><h5><strong>Print Statement</strong> print is also a statement i.e used to display the output. in can be used with paraentheses print() or without parentheses.</h5></p>\r\n      <ul>\r\n          <li>it os slower than echo.</li>\r\n          <li>using print can does not pass multiple argument.</li>\r\n          <li>print always return 1.</li>\r\n      </ul>\r\n     <?php show_source(\'syntax_txt/example3.txt\'); ?>\r\n     \r\n     \r\n      <p><h5><strong>PHP Comments</strong></h5></p>\r\n     <?php show_source(\'syntax_txt/example4.txt\'); ?>\r\n     \r\n      <p><h3 class=\"text-center text-success\"><a href=\"../blogs.php\">Thank You</a></h3></p>\r\n      </p>', 'ABHAY PRATAP SRIVASTAVA', '2021-09-28', 'PROGRAMING', 'PHP'),
(5, 'How To Declare Variable In PHP', 'Here we will discuss about PHP Variables, PHP Variables is just a name of the memory location. A variable is .......', 'http://www.softdevloper.com/blog_php/blogs_posts.php', 'HOW TO DECLARE VARIABLE IN PHP?', '<h1 class=\"text-center text-danger\">How To Declare Variable In PHP?</h1>\r\n      \r\n     <p><h5><strong>In</strong> Variable in nothing it is just a name of the memory location. A variable is simply a container i.e used to store both numeric and non-numeric information.</h5></p>\r\n     <p><h5><strong>Rules For Declaring variables</strong><br/>\r\n     <ul>\r\n         <li>Variables in PHP starts with a doller ($) sign, followed by the name of the variable.</li>\r\n         <li>The Variable name must being with a <strong>letter</strong> of the <strong>underscore</strong> character.</li>\r\n         <li>A variable name can only contain <strong>alpha-numeric</strong> characters and <strong>underscroe</strong>.</li>\r\n         <li>A variable name should not contain <storng>spaces</storng>.</li>\r\n     </ul>\r\n     </h5></p>\r\n     \r\n     <p><h5><strong>Pass multiple strings</strong></h5></p>\r\n     <?php show_source(\'php_variable_txt/variable1.txt\'); ?>\r\n     <p><h5><strong>In the above exampe $mycar is a variable which hold the value of Honda City car.</strong></h5></p>\r\n     \r\n      <p><h5><strong>Deleting the PHP variable :- </strong> To destroy a variable after using, pass the variable to PHP\'s unset() function.</h5></p>\r\n      \r\n     <?php show_source(\'php_variable_txt/variable2.txt\'); ?>\r\n     \r\n     \r\n      <p><h5><strong>PHP $ and $$ Variable</strong><br/>\r\n      $$var uses the value of the variable whose name is the value of $var. It means $$var is known as refrence variable where as $var is normal variable.<br/>\r\n      It allows you to have a \"variable\'s variable\" - hte program can create the variable name the same way it can create any string.\r\n      </h5></p>\r\n     <?php show_source(\'php_variable_txt/variable3.txt\'); ?>\r\n     \r\n     <p><h5><strong>PHP Super Global Variables</strong><br/>\r\n      PHP super global variable is used to connect PHP with HTML Form. PHP Super global variable is accessible inside the same page that defines it, as well as outside the page. While local variable\'s scope is within the page that defines is.<br/>\r\n      <strong>PHP Super Global Variables Are Given Bellow</strong>\r\n      <ul>\r\n          <li>$_GET[\'var_name\']</li>\r\n          <li>$_POST[\'var_name\']</li>\r\n          <li>$_REQUEST[\'var_name\']</li>\r\n          <li>$_FILES[\'var_name\']</li>\r\n          <li>$_SESSION[\'var_name\']</li>\r\n          <li>$_COOKIE[\'var_name\']</li>\r\n          <li>$_SERVER[\'var_name\']</li>\r\n      </ul>\r\n      </h5></p>\r\n      <p><h5><strong>PHP Constant</strong><br/>\r\n      <ul>\r\n          <li>Constant are PHP container that remain constant and never change.</li>\r\n          <li>Constant are used for data that is unchanged at multiple place within our program.</li>\r\n          <li>Variables are temporary storage while Constant are permanent.</li>\r\n          <li>Use Constant for values that remain fixed and refrenced multiple times.</li>\r\n      </ul>\r\n      <strong>How to defined using define() function</strong>\r\n      <ul>\r\n          <li>Name of the Contant</li>\r\n          <li>Value of the Constant</li>\r\n      </ul><br/>\r\n      LIKE : - define(\'ConstName\',\'value\');\r\n      </h5></p>\r\n     \r\n      <p><h3 class=\"text-center text-success\"><a href=\"../blogs.php\">Thank You</a></h3></p>\r\n      </p>', 'ABHAY PRATAP SRIVASTAVA', '2021-09-28', 'PROGRAMING', 'PHP'),
(6, 'DATA TYPES IN PHP', 'Data type is specify the size and type of values that can be stored. In PHP variable does not need to be declared its data......', 'http://www.softdevloper.com/blog_php/blogs_posts.php', 'DATA TYPES IN PHP', 'Three letters that together constitute the name of one of the world\'s most popular programming languages for we development.\r\n<ul>\r\n<li>PHP stands for PHP : Hypertext Preprocessor.</li>\r\n<li>PHP is a widely-used, open source scripting language.</li>\r\n<li>PHP scripts are executed on the server.</li>\r\n<li>PHP is free to download and use.</li>\r\n<li>PHP is a server side scripting language used to developed attractive and dynamic web pages.</li>\r\n<li>PHP is a pwerful tool for making dynamic and iteractive wen pages.</li>\r\n<li>PHP is the widely-used, free, and efficient alternative to competitors such as Microsoft\'s ASP.</li>\r\n</ul>\r\n\r\nIf you know the other server side language like ASP.NET or JSP, you might be wondering what takes PHP so special or so different from these Competing alternatives.\r\n<ul>\r\n<li>Performance</li>\r\nScripts written in php executes faster than those written in other scripting language.\r\n<li>Open Source Software (OSS)</li>\r\nPHP\'s source codes are freely available on the web. It may be used without paying any licensing fee, free download all version.\r\n<li>Platform independent</li>\r\nPHP is available for UNIX, Microsoft Windows, Mac Operating System.\r\nPHP programs are protable between platforms. As a result PHP application developed on windows will run on UNIX without any significant issues.\r\n<li>Platform independent</li>\r\nPHP is available for UNIX, Microsoft Windows, Mac Operating System.\r\nPHP programs are protable between platforms. As a result PHP application developed on windows will run on UNIX without any significant issues.\r\n<li>Database Support</li>\r\nPHP supports all most databse like Oracle, Mysql, SQL Server, Sql Lite etc.\r\n<li>All Web Server Support</li>\r\nPHP support all web server like Apache, Tomcat, IIS etc.\r\n<li>OOPS Support</li>\r\nPHP support Oops Concept.\r\n<li>Run On Low Configuration</li>\r\nPHP Support low configuration machine like P3 system.\r\n<li>Light Weight Software</li>\r\nPHP\'s software are light weight maximum cover (20-30)MB and install all the related software.\r\n</ul>\r\nHTML is embedded with PHP. PHP is easy to developed and easy to understand.', 'ABHAY PRATAP SRIVASTAVA', '2021-09-28', 'PROGRAMING', 'PHP'),
(7, 'PHP OPERATORS', 'Operators are symbols that tell the PHP processor to perform certain action............', 'http://www.softdevloper.com/blog_php/blogs_posts.php', 'OPERATORS IN PHP AND TYPES OF OPERATORS', 'Variables are simply container for holding or information. In order to do anything useful with them, you need Operators. Operators are symbols that tell the PHP Processor to preform certain actions. For example the addition(+) symbol is an operators that tells PHP to add two variables or values.\r\n<br/>\r\n<br/>\r\nThere are six Types of Operators in PHP.\r\n<br/>\r\n<br/>\r\n1.- Airthmetic Operators\r\n<br/>\r\n<br/>\r\n2.- Assignment Operators\r\n<br/>\r\n<br/>\r\n3.- Comparison Operators\r\n<br/>\r\n<br/>\r\n4.- Logical Operators\r\n<br/>\r\n<br/>\r\n5.- Increment and Decrement Operators\r\n<br/>\r\n<br/>\r\n6.- Conditional Operators\r\n<br/><br/>\r\n<br/>\r\n<br/>\r\n<br/>\r\n<br/>\r\n1.- Airthmetic Operators :- [+, -, *, /, %];\r\n<br/>\r\n2.- Assignment Operators :- [=];\r\n<br/>\r\n3.- Comparison Operators :- [==, ===, !=, !==, >, <, >=, <=];\r\n<br/>\r\n4.- Logical Operators :- [when Comparison Operators used in Conditional Statement than that operators is known as logical operators];\r\n<br/>\r\n5.- Increment and Decrement Operators :- [++, --];\r\n<br/>\r\n6.- Conditional Operators :- [>, <, etc.];\r\n<br/>\r\n\r\n', 'ABHAY SRIVASTAVA (PHP)', '2021-09-28', 'PROGRAMING', 'PHP'),
(8, 'CONDITIONAL STATEMENT IN PHP', 'PHP lets programmers evaluate different conditions during of a program and take decisions based on whether these conditions evaluate to.....', 'http://www.softdevloper.com/blog_php/blogs_posts.php', 'WHAT IS CONDITIONAL STATEMENT IN PHP', 'Conditional Statement :- PHP lets programmers evaluate different conditions during of a program and take decisions based on whether these conditions evaluate to true or false. These conditions and the actions associated with them, are expressed by means of a programming construct called a conditional statement.<br/><br/>\r\n\r\nPHP supports different types of conditional statements.<br/>\r\nâ€¢	The if Statement<br/>\r\nâ€¢	The if-else Statement<br/>\r\nâ€¢	The if-else-if Statement<br/>\r\nâ€¢	The Nested if Statement<br/>\r\nâ€¢	The Switch Statement<br/>\r\n<br/>\r\nPHP if Statement :- The if Statement is the simplest conditional statements. This works much like the English language statement. (If X happens, then do Y).<br/>\r\nSyntax :- if(condition){<br/>\r\nCode to be executed;<br/>\r\n}<br/>\r\n<br/>\r\n\r\nPHP if-else Statement :- The if statement is quite basic. It only lets you define what happens, when the condition specified evaluates true.<br/>\r\nBut if-else statement allow you to define an alternative set of actions that the program should take when the condition specified evaluates false.<br/>\r\nIn English this statement would read, â€œif X happens do Y, otherwise do Zâ€<br/>\r\nSyntax :- if(condition){<br/>\r\nCode to be executed true or false;<br/>\r\n}else{<br/>\r\nCode to be executed true of false;<br/>\r\n}<br/>\r\n<br/>\r\nPHP if-else-if Statement :- The if-else-if statement lets you chain multiple if-else statements, thus allowing the programmer to define actions of more than just tow possible outcomes.<br/>\r\nSyntax :- if(condition){<br/>\r\nCode to be executed<br/>\r\n}elseif(condition){<br/>\r\nCode to be executed<br/>\r\n}elseif(condition){<br/>\r\nCode to be executed<br/>\r\n}else{<br/>\r\nCode to be executed<br/>\r\n}\r\n<br/><br/>\r\nPHP Nested If Statement :- When we write if condition within if condition is known as nested if.<br/>\r\nSyntax: if(condition){<br/>\r\nIf(condition){<br/>\r\nThis is nested if;<br/>\r\n}<br/>\r\n}\r\n<br/><br/>\r\nPHP Switch Statement :- The Switch Statement is similar to a series of if statements on same expression.\r\nIt is multi decision making. Processing is fast then if-else. The following two examples are two different ways to write the same thing, one using a series  of if and else if statements, and the other using the switch statement.<br/>\r\n\r\nSyntax :- switch(variable)<br/>\r\n{<br/>\r\nCase 0: statement;<br/>\r\n	Break;<br/>\r\nCase 1: statement;<br/>\r\n	Break;<br/>\r\nDefault : statement;<br/>\r\n}<br/><br/>\r\nBreak Statement :- It is use to terminates switch case or a loop when the statement is correct.<br/>\r\nDefault Statement is used when in case any switch case does not marches then executes default statement.', 'ABHAY SRIVASTAVA (PHP)', '2021-09-28', 'PROGRAMING', 'PHP'),
(9, 'WHAT IS SEO AND WHY WE USE SEO', 'WHAT IS SEO AND WHY WE USE SEO, HOW TO USE SEO FOR NEW WEBSITE', 'http://www.softdevloper.com/blog_php/blogs_posts.php', 'WHAT IS SEO AND WHY WE USE SEO, HOW TO USE SEO FOR NEW WEBSITE', 'WHAT IS SEO AND WHY WE USE SEO, HOW TO USE SEO FOR NEW WEBSITE', 'ABHAY SRIVASTAVA (PHP)', '2021-12-06', 'DIGITAL MARKETING', 'SEO');
